INSERT INTO `met_res_function` VALUES (1, 'SDC_TO_DBC', '全角转半角函数', 'UDF', 'com.ytbig.udf.SbcToDbc', 'odps-function-1.0-SNAPSHOT.jar', '全角字符转为半角字符', '\nSDC_TO_DBC(str)', 'str     STRING     必填      源字符串', 'SRRING     正常返回STRING类型字符串     NULL值或者空字符串返回为NULL', 'SDC_TO_DBC(“\"呼　数据部”)', 1, '小芳', '小明', '2023-02-07 17:30:54', '2023-02-07 17:30:54', 0);
INSERT INTO `met_res_function` VALUES (2, 'IDCARD_CONVERT', '身份证转换函数', 'UDF', '\ncom.ytbig.udf.ConvertIdCard', '\nodps-function-1.0-SNAPSHOT.jar', '一代15位身份证转换为二代标准18位身份证件号', '\nIDCARD_CONVERT(idcard)', 'idcard      STRING     必填      身份证件号码', '返回值：       SRRING     合法身份证件号码（一代和二代）返回为标准18位二代身份证件号码    不合法身份证件号码 返回为NULL', '\nIDCARD_CONVERT(\"3100000209300004\")', 1, '小芳', '小明', '2023-02-07 17:30:54', '2023-02-07 17:30:54', 0);
INSERT INTO `met_res_function` VALUES (3, 'IDCARD_VERIFY', '身份证校验函数', 'UDF', 'com.ytbig.udf.IdCardVerification', 'odps-function-1.0-SNAPSHOT.jar', '身份证校验，判断是否是合法的身份证（一代和二代）', 'IDCARD_VERIFY(idCardStr)', 'idCardStr     STRING      必填     身份证件号', 'BOOLEAN             TRUE      合法身份证件号        FALSE    不合法身份证件号', 'IDCARD_VERIFY(“3100000749949948”)', 1, '小芳', '小明', '2023-02-07 17:30:54', '2023-02-07 17:30:54', 0);
